import { useState } from 'react';
function App() {
  const values = [true, 'sm-down', 'md-down', 'lg-down', 'xl-down', 'xxl-down'];
  const [fullscreen, setFullscreen] = useState(true);
  const [show, setShow] = useState(false);


  function handleShow() {
    setFullscreen(0);
    setShow(true);
  }


  return (<div >
    <ModeProvider>
      <Mode />
      <Header className='header' />
      <Body />
      <Footer />
    </ModeProvider>

  </div>

  );
}


export default App;
